import React from "react";
import {Link} from "react-router-dom";
import {ROUTES} from "../../routes/constants";

const Header: React.FC = () => {
  return (
    <div className="bg-white h-20  shadow-md">
      <div className="flex">
        <div className="flex-initial w-1/2 text-2xl font-bold mx-5 my-5">Movies DB</div>
        <div><Link to={ROUTES.HOME}>HOME</Link></div>
        <div><Link to={ROUTES.POPULAR}>POPULAR</Link></div>
        <div><Link to={ROUTES.POPULAR}>TOP RATED</Link></div>
        <div><Link to={ROUTES.POPULAR}>NOW PLAYING</Link></div>
        <div><Link to={ROUTES.POPULAR}>MY FAVORITES</Link></div>
      </div>
    </div>

  );
}

export default Header;
